import React from 'react';
import qa from '../../qa.svg';
import "./Home.css";
import { Card, Button } from 'react-bootstrap';
import Background from '../../laptop1.jpg';

var sectionStyle = {
    width: "100%",
    height: "400px",
    backgroundImage: `url(${Background})`
  };

const Home = () => (
    <div className="Home">
        <div className="header">
            <img src={qa} alt="quality" className="ml-auto"/>
            <h1>Custom quality services to meet your needs!</h1>
        </div>
        <div className="lander">
            <Card id="newsletter-card" className="mx-auto">
                <Card.Header>Featured</Card.Header>
                <Card.Body>
                    <Card.Title>Stay in the know by joining our newsletter!</Card.Title>
                    <Card.Text>
                    With supporting text below as a natural lead-in to additional content.
                    </Card.Text>
                    <Button variant="primary">Go somewhere</Button>
                </Card.Body>
            </Card>
        </div>
    </div>
);

export default Home;
